eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\n/* harmony import */ var pdfjs_dist__WEBPACK_IMPORTED_MODULE_0__ = __webpack_require__(/*! pdfjs-dist */ \"(rsc)/./node_modules/pdfjs-dist/build/pdf.js\");\n/* harmony import */ var pdfjs_dist__WEBPACK_IMPORTED_MODULE_0___default = /*#__PURE__*/__webpack_require__.n(pdfjs_dist__WEBPACK_IMPORTED_MODULE_0__);\n\nconst pageContent = [\n    {\n        id: \"elektrikli1\",\n        title: \"Orta Şömine Hazneleri\",\n        content: \"Gaziantep, Adana, Kahramanmaraş, Malatya, Hatay, Şanlıurfa, Adıyaman ve tüm Güneydoğu Bölgesi'nde kaliteli şömine hizmetleri sunuyoruz. Orta şömine, estetik ve fonksiyonelliği bir arada sunan geleneksel bir ısıtma çözümüdür. Genellikle odanın merkezine yerleştirilen bu şömineler, odadaki havayı ısıtarak sıcak ve rahat bir ortam yaratır. Odun, kömür, gaz veya elektrikle çalışan orta şömineler, yalnızca etkili bir ısınma sağlamaz, aynı zamanda odanın dekorasyonuna da zarif bir dokunuş katar. Şöminenin yaydığı sıcak hava, kış aylarında evinize samimi ve huzurlu bir atmosfer kazandırır. Modern ısıtma sistemlerine göre daha doğal bir ısınma sağlayan orta şömineler, görsel zenginliği ve estetik yönüyle de odanın odak noktası haline gelir. Bazı evler enerji verimliliği nedeniyle farklı ısıtma yöntemlerini tercih etse de, orta şömineler hâlâ geleneksel sıcaklıkları ve görsel zarafetleri ile tercih edilmeye devam etmektedir.\",\n        images: [\n            \"/Şömine Grupları/orta-3.jpg\",\n            \"/Şömine Grupları/orta-4.jpg\"\n        ],\n        pdf: \"/katalog2.pdf\"\n    },\n    {\n        id: \"elektrikli2\",\n        title: \"Elektrikli Şömine Hazneleri \",\n        content: \"Gaziantep, Adana, Kahramanmaraş, Malatya, Hatay, Şanlıurfa, Adıyaman ve tüm Güneydoğu Bölgesi'ne elektrikli şömine hizmeti de sunmaktayız. Elektrikli şömineler, odun, gaz ya da bio ethanol gibi geleneksel yakıtlar yerine elektrikle çalışan, daha düşük ısıtma kapasitesine sahip (1000–2000 W) modern ısıtma çözümleridir. Bu şömineler, özellikle baca sistemi bulunmayan mekanlarda görsel efekt yaratmak için tercih edilir. Elektrikli şöminelerin en büyük avantajlarından biri, kurulumu ve kullanımı son derece kolay olması, ayrıca temizlik gerektirmemesidir. Uzaktan kumanda ile kolayca kontrol edilebilen bu şömineler, baca bağlantısı gerektirmediği için mekanınıza istediğiniz her yere yerleştirilebilir. Ayrıca, kare, dikdörtgen veya lineer formlarda üretilen elektrikli şöminelere, gerçek şöminelere uygulanan her tarzda dış giydirmeler yaparak, dekoratif açıdan daha şık ve zarif bir görünüm elde edebilirsiniz.\",\n        images: [\n            \"/Şömine Grupları/elekrtikli-1.jpg\",\n            \"/Şömine Grupları/elekrtikli-2.jpg\",\n            \"/Şömine Grupları/elekrtikli-3.jpg\"\n        ],\n        pdf: \"/katalog.pdf\"\n    },\n    {\n        id: \"elektrikli3\",\n        title: \"Bioethanol Şömine Hazneleri \",\n        content: \"Gaziantep, Adana, Kahramanmaraş, Malatya, Hatay, Şanlıurfa, Adıyaman ve tüm Güneydoğu Bölgesi'nde etanol şömineleri hizmeti sunuyoruz. Etanol şömine hazneleri, çevre dostu etanol yakıtı ile çalışan modern ısıtma çözümleridir. Bu şömineler, yanma sırasında yalnızca su buharı ve karbondioksit üretir, böylece çevreye zarar vermezler. Taşınabilir veya duvara monte edilebilen modelleri, mekanınıza esneklik ve kullanım kolaylığı sağlar. Elektrik ya da gaz bağlantısı gerektirmemesi nedeniyle kurulumu oldukça basittir. Estetik açıdan şık ve minimalist tasarımlar sunarak, modern iç mekanlarınıza zarif bir dokunuş katar. Isı verimi geleneksel şömineler kadar yüksek olmasa da, sıcak ve samimi bir atmosfer yaratır. Ayrıca, güvenlik önlemleriyle donatılmış olup, çevre dostu ve pratik bir ısıtma çözümü sunar..\",\n        images: [\n            \"/Şömine Grupları/ethanol-1.jpg\",\n            \"/Şömine Grupları/ethanol-2.jpg\"\n        ],\n        pdf: \"/katalog.pdf\"\n    },\n    {\n        id: \"elektrikli4\",\n        title: \"Barbeküler \",\n        content: \"Gaziantep, Adana, Kahramanmaraş, Malatya, Hatay, Şanlıurfa, Adıyaman ve tüm Güneydoğu Bölgesi'nde barbekü şömine  hizmeti sunuyoruz. Barbekü şömine, açık havada yemek pişirme amacıyla kullanılan ve genellikle bahçelerde veya teraslarda tercih edilen bir şömine türüdür. Et, balık, sebze gibi yiyecekler,  ızgarasında ateşte pişirilir. Bu şömineler, odun, kömür, gaz ya da elektrik gibi çeşitli yakıtlarla çalışabilen modellerle sunulur. Metal, taş ve seramik gibi dayanıklı malzemelerden üretilen barbekü şömineleri, taşınabilir veya sabit olarak tercih edilebilir. Birçok model, ek aksesuarlar (ızgara, kapak, yan masa vb.) ile birlikte gelir ve kullanımı oldukça pratiktir. Düzenli bakım gerektiren bu şömineler, açık havada lezzetli yemekler yapmak isteyenler için mükemmel bir seçimdir.\",\n        images: [\n            \"/Şömine Grupları/barbeku-1.jpg\",\n            \"/Şömine Grupları/barbeku-2.jpg\"\n        ],\n        pdf: \"/katalog2.pdf\"\n    },\n    {\n        id: \"elektrikli5\",\n        title: \"Klasik Şömine Hazneleri\",\n        content: \"Gaziantep, Adana, Kahramanmaraş, Malatya, Hatay, Şanlıurfa, Adıyaman ve tüm Güneydoğu Bölgesi'nde klasik şömine hizmeti sunuyoruz. Klasik şömine hazneleri, geleneksel şöminelerin temel bileşenleridir ve genellikle odun veya kömür gibi yakıtların yanmasını sağlayarak iç mekanları ısıtır. Bu hazneler, odadaki havayı ısıtarak aynı zamanda estetik bir görüntü sunar. Taş, mermer veya dökme demir gibi dayanıklı ve görsel açıdan hoş malzemelerle üretilen bu şömineler, işlevselliği ile birlikte dekoratif bir unsur olarak da odanıza şıklık katar. Klasik şömine hazneleri, tarihsel tasarımlar ve zarif süslemelerle zenginleştirilebilir; oymalar, mermer kaplamalar veya dekoratif desenler, odanızın genel dekorasyonuyla uyum sağlar. Ancak, modern ısıtma sistemlerine kıyasla verimlilikleri düşüktür, çünkü ısı büyük ölçüde baca aracılığıyla kaybolur. Bu nedenle, klasik şömineler genellikle ısınma yerine atmosfer yaratma amacı güder.\",\n        images: [\n            \"/Şömine Grupları/klasik-1.jpg\",\n            \"/Şömine Grupları/klasik-2.jpg\",\n            \"/Şömine Grupları/klasik-3.jpg\",\n            \"/Şömine Grupları/klasik-4.jpg\",\n            \"/Şömine Grupları/klasik-5.jpg\",\n            \"/Şömine Grupları/klasik-6.jpg\"\n        ],\n        pdf: \"/katalog2.pdf\"\n    },\n    {\n        id: \"elektrikli6\",\n        title: \"U Tipi Şömine Hazneleri \",\n        content: \"Gaziantep, Adana, Kahramanmaraş, Malatya, Hatay, Şanlıurfa, Adıyaman ve tüm Güneydoğu Bölgesi'nde U tipi şömine yapımı hizmeti sunuyoruz. U tipi şömine hazneleri, duvarın iki yanında yer alan ve odada “U” şeklinde bir açıklık oluşturan tasarımlardır. Bu yapı, odanın iki yönünde etkili bir şekilde ısıtma sağlarken, estetik açıdan da şık bir odak noktası oluşturur. Taş, mermer veya dökme demir gibi dayanıklı malzemelerle zenginleştirilen bu tasarımlar, odanızın dekorasyonuna zarif bir katkı sağlar. U tipi şömineler, odun, gaz veya elektrik gibi farklı yakıt türleriyle çalışabilir ve ısıyı iki yönde daha verimli bir şekilde dağıtarak daha geniş alanlarda etkili ısınma sağlar. Ancak, düzenli bakım gerektirir ve güvenlik önlemleri alınmalıdır. Enerji verimliliği sınırlı olabilir, bu nedenle modern ısıtma sistemlerine kıyasla daha fazla bakım ve dikkat gerektirir. Yine de, estetik ve işlevsellik açısından iç mekanınıza sıcaklık ve rahat bir atmosfer katar.\",\n        images: [\n            \"/Şömine Grupları/u-tipi-1.jpg\",\n            \"/Şömine Grupları/u-tipi-1.jpg\",\n            \"/Şömine Grupları/u-tipi-1.jpg\"\n        ],\n        pdf: \"/katalog2.pdf\"\n    },\n    {\n        id: \"elektrikli7\",\n        title: \"L Tipi Şömine Hazneleri \",\n        content: \"Gaziantep, Adana, Kahramanmaraş, Malatya, Hatay, Şanlıurfa, Adıyaman ve tüm Güneydoğu Bölgesi'nde L tipi şömine yapımı hizmeti sunuyoruz. L tipi şömine hazneleri, genellikle köşe şömineleri veya iki oda arasındaki duvarlarda tercih edilen şık ve işlevsel tasarımlardır. Bu tasarımlar, hem estetik açıdan göz alıcıdır hem de verimli ısınma sağlar; böylece her iki odanın ısınmasına olanak tanır. Odun veya gazlı modelleri mevcut olup, geleneksel şömine hissiyatı ya da pratik kullanım imkânı sunar. İç mekan dekorasyonuna uyum sağlaması için dekoratif taşlar veya seramik fayanslarla kaplanabilir. Yüksek ısı verimi sayesinde enerji tasarrufu sağlarken, düzenli bakım ve temizlik gerektirdiğini unutmamak önemlidir. Güvenlik standartlarına ve yerel bina yönetmeliklerine uygun bir kurulum yapılması, uzun ömürlü ve güvenli bir kullanım için gereklidir. Profesyonel destekle, L tipi şömineler, estetik ve fonksiyonel açıdan mükemmel bir seçenek sunar.\",\n        images: [\n            \"/Şömine Grupları/l-tipi-1.jpg\",\n            \"/Şömine Grupları/l-tipi-1.jpg\",\n            \"/Şömine Grupları/l-tipi-1.jpg\"\n        ],\n        pdf: \"/katalog2.pdf\"\n    },\n    {\n        id: \"elektrikli8\",\n        title: \"Şömine Aksesuarları  \",\n        content: \"Gaziantep, Adana, Kahramanmaraş, Malatya, Hatay, Şanlıurfa, Adıyaman ve tüm Güneydoğu Bölgesi'nde şömine aksesuarları hizmeti sunuyoruz. Şömine aksesuarları, şöminenizin bakımını, güvenliğini ve kullanımını kolaylaştırırken estetik değerini artırır. Öne çıkan aksesuarlar arasında:    Izgarası: Yiyecekleri pişirmek için idealdir, özellikle barbekü şöminelerinde kullanılır.Şömine Süpürgesi ve Kürek: Kül ve kurumu temizleyerek şöminenin düzenini korur.  Koruma Ekranı veya Cam Kapak: Kıvılcım yayılmasını önler, güvenliği artırır.  Odun Saklama Rafı: Odunları düzenli tutar ve kolay erişim sağlar. Şömine Takımları: Süpürge, kürek ve cımbız gibi araçlardan oluşur. Şömine Rafı: Dekoratif veya işlevsel amaçlarla kullanılabilir. Bu aksesuarlar, şöminenizi daha verimli, temiz ve güvenli hale getirirken estetik bir dokunuş sunar. Güvenlik önlemlerine dikkat ederek aksesuarları üretici talimatlarına uygun kullanmanız önemlidir.\",\n        images: [\n            \"/Şömine Grupları/aksesuar.jpg\",\n            \"/Şömine Grupları/aksesuar-2.jpg\"\n        ],\n        pdf: \"/katalog.pdf\"\n    }\n];\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (pageContent);\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///(rsc)/./constants/pageContent.js\n");

